@Eric Nunya Except he's literally been on other peoples' podcasts before saying "I don't believe that there are extra-dimensional demons and stuff like that, _they_ believe that." I've actually looked into the demon claim in a great deal, and where that comes from, is what Alex Jones believes the people are the top are doing, is getting people who are incredibly fit and healthy, people who are basically at the peak of human physical condition, putting them into medically induced comas, stopping their hearts, and IV-dripping them DMT. They do this, according to Jones, because they believe it gives them access to the knowledge of demons, as in it puts them into a state where they can reach these things in their dreams to contact and learn from them. Again, according to Jones, they believe that this is how they've learned a great deal of what they have about technology, science, medicine, knowledge of the future, etc, and the funny thing is, people have been talking about this stuff since the middle ages, if not earlier. There are all sorts of magical grimoires written with directions not just about how to contact demons, but how to contact specific demons to learn specific things. As soon as I heard Jones explaining this, I thought to myself, 'yeah, I know that exact ritual from the Lesser Key of Solomon.' Jones has said on other peoples' shows, explicitly, that he believes the people who believe this stuff, are crazy.

That said, he has also said things that are meant to be an explanation for something when he was talking to another person, one of those being "well, that's because lobsters are psychic." Personally, I don't think he was being serious when he said that, and the reason I say that, is because of the context of that specific podcast. Jones had a grin on his face, and the conversation was perfectly normal until he decided to take it into the realm of weird, and the delivery of the line was ideally suited for comedic effect. Can't say for sure though. Maybe he was being serious.

Lastly, I'd like to leave you with this. A _lot_ of people believe demon possession is a real thing, even in the developed Western world. That doesn't make them nutjobs, unless you believe anyone who practices a typical religion is crazy. Say Jones' above description of DARPA's activities (that was the group he accused specifically of the DMT thing), if your average Christian saw that, and realized what they were doing, would it really be so crazy for that Christian to conclude something like 'these people are trying to contact demons to gain knowledge from them, this is literal demon possession/worship?' Jones has said before that he is a Christian, so given that, even if he were to believe in the demon possession thing, which again, I don't believe he does based on other things he has said, I don't think it would be that crazy for him to see that and conclude 'demon possession.'
